import React, { useState, useEffect } from "react";
import ScreenHeading from "../../utilities/ScreenHeading/ScreenHeading";
import ScrollService from "../../utilities/ScrollService";
import Animations from "../../utilities/Animations";

export default function Resume(props) {
  const [selectedBulletIndex, setSelectedBulletIndex] = useState(0);
  const [carousalOffSetStyle, setCarousalOffSetStyle] = useState({});

  const Resume = (props) => {
    <div className="resume_heading">
      <div className="resume_main_heading">
        <div className="heading_bullet">
          <span>{props.heading ? props.heading : ""}</span>
          {props.fromDate && props.toDate ? (
            <dov className="heading_date">
              {props.fromDate + "_" + props.toDate}
            </dov>
          ) : (
            <div></div>
          )}
        </div>
        <div className="resume_sub_heading">
          <span>{props.subHeading ? props.subHeading : ""}</span>
        </div>
        <div className="resume_heading_description">
          <span>{props.description ? props.description : ""}</span>
        </div>
      </div>
    </div>;
  };

  const resumeBullets = [
    { label: "Education", logoSrc: "education.svg" },
    { label: "Work History", logoSrc: "work-history.svg" },
    { label: "Programming Skills", logoSrc: "programming-skills.svg" },
    { label: "Projects", logoSrc: "projects.svg" },
    { label: "Interests", logoSrc: "interests.svg" },
  ];

  const programmingSkillDetails = [
    { skill: "Python", ratingPercentage: 85 },
    { skill: "C", ratingPercentage: 85 },
    { skill: "Javascript", ratingPercentage: 65 },
    { skill: "React Js", ratingPercentage: 65 },
    { skill: "SQL", ratingPercentage: 75 },
    { skill: "PostgreSQL", ratingPercentage: 75 },
    { skill: "Excel and VBA", ratingPercentage: 85 },
    { skill: "PowerBi", ratingPercentage: 85 },
  ];

  const projectDetails = [
    {
      title: "Portfolio Website",
      duration: { toDate: "2022" },
      description:"Portfolio project website to showcase all my details and achievements in one place.",
      subHeading: "Technologies Used: React JS and Bootstrap",
    },
    {
        title: "Full Stack Open @ Univeristy of Helsinki",
        duration: { fromDate: "2022" },
        description:"Open university course to learn modern web development in React, Redux, Node.js, MongoDB, GraphQL and TypeScript.",
        subHeading: "Technologies Used: React, Redux, Node.js, MongoDB, GraphQL and TypeScript",
      },
    {
      title: "Dynamic Waste collection simulation",
      duration: { toDate: "2022" },
      description:"Simulation of dynamic and static waste collection as a part of Bachelors thesis at LUT University",
      subHeading: "Technologies Used: Excel, Python (Pandas, Sklearn, Folium) and Docker",
    },
    {
      title: "Food diary application Java/Android",
      duration: { toDate: "2021" },
      description:"Group project as a part of Java development course. Application uses multiple API's to get nutritional data of users daily foos intake.",
      subHeading: "Technologies Used: Java and Androidstudio",
    },
  ];

  const resumeDetails = [
    <div className="resume_screen_container" key="education">
        <ResumeHeading
        heading={"LUT University"}
        subHeading={"Master of Sciene, Data-analytics in Decision Making"}
        fromdate={"2023"}
        toDate={" "}
        />
        <ResumeHeading
        heading={"LUT University"}
        subHeading={"Bachelor's degree, Industrial Engineering and Management"}
        fromdate={"2020"}
        toDate={"2023"}
        />
        <ResumeHeading
        heading={"Shadow Ridge High School"}
        subHeading={"Exchange student"}
        fromdate={"2016"}
        toDate={"2017"}
        />
        <ResumeHeading
        heading={"Muurame High School"}
        subHeading={"Upper secondary level"}
        fromdate={"2015"}
        toDate={"2019"}
        />
    </div>
  ]


  let fadeInScreenHandler = (screen) => {
    if (screen.fadeScreen !== props.id) return;
    Animations.animations.fadeInScreen(props.id);
  };

  const fadeInSubscription =
    ScrollService.currentScreenFadeIn.subscribe(fadeInScreenHandler);

  return (
    <div className="resume_container screen_container" id={props.id || ""}>
      <div className="resume_content">
        <ScreenHeading title={"Resume"} subHeading={"Bio Details"} />
      </div>
    </div>
  );
}
